INSERT INTO `product` VALUES(298, 17, 'GAF-298 GAF001', '<h1>\n	Commercial Restaurant Booths\n</h1>\n<p>\n	We offer a high quality range of <strong>booths</strong>, ideally suited as&nbsp; restaurant furniture,bar furniture and brasserie furniture.\n</p>\n<p>\n	If you are looking for a selection of booths, We have a wide variety of&nbsp; booths.Find exactly what you need without having to compromise the seating plan&nbsp; you envisioned.\n</p>\n<p>\n	Our excellent range of booths is particularly strong, offering the ultimate&nbsp; choice and quality, all at fantastic prices.\n</p>', 0);
INSERT INTO `product` VALUES(299, 3, 'GAF-299 GAF002', '<h1>\n	Commercial Restaurant Booths\n</h1>\n<p>\n	We offer a high quality range of <strong>booths</strong>, ideally suited as&nbsp; restaurant furniture,bar furniture and brasserie furniture.\n</p>\n<p>\n	If you are looking for a selection of booths, We have a wide variety of&nbsp; booths.Find exactly what you need without having to compromise the seating plan&nbsp; you envisioned.\n</p>\n<p>\n	Our excellent range of booths is particularly strong, offering the ultimate&nbsp; choice and quality, all at fantastic prices.\n</p>', 0);
INSERT INTO `product` VALUES(300, 20, 'GAF-300 GAF-T001', '<p>\n	We offer a wide selection of quality <strong>table tops</strong> that suit&nbsp; all situations and budgets and can be used for indoor and outdoor use.\n</p>\n<p>\n	Our table tops are ideal for wide range venues and can be used as; dining&nbsp; room table tops and outdoor table tops, cafe table tops, hotel and restaurant&nbsp; table tops and many more.&nbsp;\n	<p>\n		We can create any table top to any size shape and style so if you have a&nbsp; request please contact our sales team for assistance.\n	</p>', 0);
